$bodyColor: #212121;
$elevatedContainerColor: #eeeeee;
$depressedContainerColor: rgb(39, 39, 39);
$lightBGTextColor: rgb(39, 39, 39);
$darkBGTextColor: white;
$highlight1Color: #0d7377;
$highlight2Color: #32e0c4;
/* Colors: 212121, 0d7377, 32e0c4, eeeeee */

@import url('https://fonts.googleapis.com/css2?family=Ubuntu&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Audiowide&display=swap');

@mixin xyCenter() {
    display: flex;
    justify-content: center;
    align-items: center;
}

* {
    font-family: 'Ubuntu', sans-serif;
    color: $lightBGTextColor;
}

body {
    background: $bodyColor;
}

header {
    height: 10vh;
    @include xyCenter();

    background: $depressedContainerColor;
    border-radius: 5px;

    color: $darkBGTextColor;
    font-family: 'Audiowide', cursive;
    font-size: 3vw;

    span {
        color: $highlight2Color;
        font-family: Verdana, Geneva, Tahoma, sans-serif;
    }
}

li {
    color: $darkBGTextColor;
    &:hover { color: $highlight2Color; }
}

.primary-btn {
    margin-top: 4vh;
    width: 10vw;
    padding: 10px 0 10px 0;
    border: $highlight1Color solid 1px;
    border-radius: 7px;
    color: $highlight1Color;
    transition: ease-in 0.2s;
    font-size: 1.5vw;
    outline: none;

    &:hover {
        background: $highlight1Color;
        color: white;
        transition: ease-in 0.2s;
        cursor: pointer;
    }
}

.AVEM_Container {
    margin-top: 2vh;
    height: 85vh;

    .row {
        display: flex;
        height: 100%;
        align-items: center;
    }

    .column {
        flex: 50%;
        height: 50vh;
        margin-left: 2vw;
        margin-right: 2vw;
    }

    #AVEM_About {
        padding: 0 25px 0 25px;

        background: $elevatedContainerColor;
        border-radius: 8px;
        box-shadow: 2px 2px 8px rgb(17, 17, 17), -1px -1px 10px rgb(17, 17, 17); 

        h1 {
            text-align: center;
            color: $highlight1Color;
            font-size: 3vw;
        }

        p {
            padding-top: 10px;
            font-size: 1.5vw;
        }
    }

    #AVEM_Upload {
        text-align: center;

        /* p { 
            color: $darkBGTextColor;
            font-size: 2vw;
        } */

        .video_upload_container {
            margin-top: 5vh;
            display: flex;
            justify-content: center;

            div {
                padding: 25px;
                border: gainsboro dotted 1px;
                width: fit-content;

                input { 
                    color: $highlight2Color; 
                    font-size: 1.5vw;
                }
            }
        }

        .progress_bar_container {
            display: flex;
            justify-content: center;
            margin-top: 3vh;

            #progress {
                border: 1px solid $highlight1Color;
                width: 60%;
                height: 10px;
                border-radius: 20px;
            }
            #progress > #percent {
                height: 10px;
                border-radius: 20px;
                background-color: $highlight2Color;
            }

            span { 
                font-size: 1.5vw; 
                color: $highlight2Color;
            }

            button { 
                width: fit-content;
                padding: 5px 10px 5px 10px;
                border-radius: 5px;
                margin-left: 10px;
                font-size: 1.5vw;

                i {
                    font-size: 1.5vw; 
                    color: $highlight1Color;
                    transition: ease-in 0.2s;
                }

                &:hover {
                    i { 
                        transition: ease-in 0.2s;
                        color: white; 
                    }
                }
            }
        }
    }
}

.AVEM_Event_Selection_Container {
    margin-top: 2vh;
    height: 85vh;

    .row {
        display: flex;
        height: 85%;
        align-items: center;
    }

    .column {
        flex: 50%;
        margin-left: 2vw;
        margin-right: 2vw;
    }

    #video_container {
        video {
            width: 99%;
            border: $highlight1Color solid 1px;
        }

        form {
            margin-left: 20px;
            border: white solid 1px;
            padding: 20px;
            display: inline;

            input {
                font-size: 1.5vw;
            }
            button {
                margin-left: 10px;
                padding: 3px 8px 3px 8px;
                border: $highlight1Color solid 1px;
                border-radius: 5px;
                color: $highlight1Color;
                transition: ease-in 0.2s;
                font-size: 1.2vw;
                outline: none;

                &:hover {
                    background: $highlight1Color;
                    color: white;
                    transition: ease-in 0.2s;
                    cursor: pointer;
                }
            }
        }
    }

    #event_list_container {
        border: gainsboro solid 1px;
        height: 60vh;
        overflow-y: scroll;

        h1 {
            text-align: center;
            color: $highlight1Color;
        }

        .event_item {
            padding: 10px;
            border: gainsboro solid 1px;
            color: $darkBGTextColor;
        }
    }
}
